import React from "react";
import { Link } from "react-router";
import "./Navbar.css";

export default function Navbar() {
  return (
    <div>
      <ul>
        <li>
          <Link to="/react"> Home</Link>
        </li>
        <li>
          <a href="#">About</a>
        </li>
        <li>
          <a href="#">Contact</a>
        </li>
      </ul>
    </div>
  );
}
